const c =
{
    FOV: 108 * 720/1280,
    WIDTH: 1280,
    HEIGHT: 720,
    NEAR: .01,
    FAR: 1000
}


function cartesian2polar(position){
    var r=Math.sqrt(position.x*position.x + position.z*position.z + position.y*position.y);
  
    return({
      r: r,  
      phi:Math.acos(position.y / r),
      theta:Math.atan2(position.z, position.x)
    });
}
function polar2cartesian(polar){
    return({
        x: polar.distance * Math.cos(polar.radians),
        z: polar.distance * Math.sin(polar.radians)
    });
}
function polar2canvas(polarPoint) {
  return({
    y: polarPoint.phi/Math.PI,
    x: (polarPoint.theta+Math.PI) / (2*Math.PI)
  })
}
function _assignUVs(geometry) {
    var polarVertices = geometry.vertices.map(cartesian2polar);
    geometry.faceVertexUvs[0] = [];
    geometry.faces.forEach(function(face) {
  
      var uvs = [];
      var ids = [ 'a', 'b', 'c'];
  
      for( var i = 0; i < ids.length; i++ ) {
        var vertexIndex = face[ ids[ i ] ];
        var vertex = polarVertices[ vertexIndex ];
        if(vertex.theta === 0 && (vertex.phi === 0 || vertex.phi === Math.PI)) {
          var alignedVertice = vertex.phi === 0 ? face.b : face.a;
  
          vertex = {
            phi: vertex.phi,
            theta: polarVertices[ alignedVertice ].theta
          };
        }
        if(vertex.theta === Math.PI && cartesian2polar(face.normal).theta < Math.PI/2) {
          vertex.theta = -Math.PI;
        }
  
        var canvasPoint = polar2canvas(vertex);
        uvs.push( new THREE.Vector2( 1-canvasPoint.x, 1-canvasPoint.y ) );
      }
  
      geometry.faceVertexUvs[ 0 ].push( uvs );
    });
    geometry.uvsNeedUpdate = true;
}

const scene = new THREE.Scene();
const camera = new THREE.PerspectiveCamera(c.FOV, c.WIDTH / c.HEIGHT, c.NEAR, c.FAR);
camera.position.z = 15;
camera.updateProjectionMatrix();
const renderer = new THREE.WebGLRenderer();
renderer.setClearColor(new THREE.Color(0x0000ff));
renderer.setSize(c.WIDTH, c.HEIGHT);
document.body.appendChild(renderer.domElement);

const cube_verts = new THREE.BoxGeometry(1, 1, 1);
const material = new THREE.MeshLambertMaterial({ color: 0x00ff00, fog: false });
const cube = new THREE.Mesh(cube_verts, material);
cube.position.set(5, 0, 0);
scene.add(cube);
const ambient = new THREE.AmbientLight(0xffffff * .2);
scene.add(ambient);
const directional = new THREE.DirectionalLight(0xffffff, .5);
directional.position.set(1, 1, 10);
scene.add(directional);

const src = `data:image/jpeg;base64,`
const image = new Image();
var texture = new THREE.Texture(image);
image.onload = () =>  { texture.needsUpdate = true; };
image.src = src;

const sphere_verts = new THREE.SphereGeometry(2, 32, 16);
_assignUVs(sphere_verts);
const sphere_mat = new THREE.MeshLambertMaterial({ map: texture });
scene.add(new THREE.Mesh(sphere_verts, sphere_mat));


function update()
{
    requestAnimationFrame(update);
    renderer.clear();
    renderer.render(scene, camera);
    cube.rotation.x += .01;
    cube.rotation.z += .01;
    cube.position.x += .01;
}
update()